import Image from '../components/Image';

const Index = () => (
    <div>
        <h1>SSR Magician</h1>
        <Link href='/about'>
            <button>About(CSR)</button>
        </Link>
        <Image/>
        <Link href='/robots'>
            <button>Robots</button>
        </Link>
        {/* <a href ='/about'>About(SSR)</a> */}
    </div>
);

export default Index;
